-- Volcando estructura de base de datos para demo_usuarios
CREATE DATABASE IF NOT EXISTS `demo_usuarios` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;
USE `demo_usuarios`;

-- Volcando estructura para procedimiento demo_usuarios.ALTAS
DELIMITER //
CREATE PROCEDURE `ALTAS`(
  IN iNOMBRE VARCHAR(100),
  IN iPAPELLIDO VARCHAR(100),
  IN iSAPELLIDO VARCHAR(100),
  IN iCURP VARCHAR(18),
  IN iNAC DATE,
  IN iGENERO VARCHAR(20),
  IN iLOGIN VARCHAR(50),
  IN iPWD VARCHAR(255),
  IN iFOTO LONGTEXT
)
BEGIN
  INSERT INTO usuarios(nombre, apellido_p, apellido_m, curp, nacimiento, genero, login, pwd_hash)
  VALUES(iNOMBRE, iPAPELLIDO, iSAPELLIDO, iCURP, iNAC, iGENERO, iLOGIN, iPWD);
  SET @uid = LAST_INSERT_ID();
  IF iFOTO IS NOT NULL THEN
    INSERT INTO fotos(usuario_id, base64) VALUES(@uid, iFOTO);
  END IF;
END//
DELIMITER ;

-- Volcando estructura para procedimiento demo_usuarios.BAJAS
DELIMITER //
CREATE PROCEDURE `BAJAS`(IN iID INT)
BEGIN
  DELETE FROM usuarios WHERE id=iID;
END//
DELIMITER ;

-- Volcando estructura para procedimiento demo_usuarios.CAMBIOS
DELIMITER //
CREATE PROCEDURE `CAMBIOS`(
  IN iID INT,
  IN iNOMBRE VARCHAR(100),
  IN iPAPELLIDO VARCHAR(100),
  IN iSAPELLIDO VARCHAR(100),
  IN iCURP VARCHAR(18),
  IN iNAC DATE,
  IN iGENERO VARCHAR(20),
  IN iLOGIN VARCHAR(50),
  IN iPWD VARCHAR(255),
  IN iFOTO LONGTEXT
)
BEGIN
  UPDATE usuarios
  SET nombre=iNOMBRE,
      apellido_p=iPAPELLIDO,
      apellido_m=iSAPELLIDO,
      curp=iCURP,
      nacimiento=iNAC,
      genero=iGENERO,
      login=iLOGIN,
      pwd_hash=COALESCE(iPWD,pwd_hash)
  WHERE id=iID;

  IF iFOTO IS NOT NULL THEN
    DELETE FROM fotos WHERE usuario_id=iID;
    INSERT INTO fotos(usuario_id, base64) VALUES(iID, iFOTO);
  END IF;
END//
DELIMITER ;

-- Volcando estructura para tabla demo_usuarios.fotos
CREATE TABLE IF NOT EXISTS `fotos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `usuario_id` int(11) DEFAULT NULL,
  `base64` longtext DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `usuario_id` (`usuario_id`),
  CONSTRAINT `fotos_ibfk_1` FOREIGN KEY (`usuario_id`) REFERENCES `usuarios` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

